import React from 'react';

class VaccineRecord extends React.Component {

constructor(props){
    super();
    this.state={
        vaccine: null
    }
}
  componentDidMount() {
    const apiUrl = 'http://localhost:3001/vaccine';
    fetch(apiUrl)
      .then((response) => response.json())
      .then((data) => console.log('This is your data', data));
  }
  render() {
    return( 
        <div>
    <h1>my Component has Mounted, Check the browser 'console' </h1>
    {
        this.state.vaccine ?
        this.state.vaccine.map((item,i)=>
        <div><p>
        {i}--
        {item.vaccine_id}
        {item.title}
        </p></div>)
        :
        null
    }

</div>
    )
  }
}
export default VaccineRecord;
